	devicesStore.getRegistryValues = function (device) {
	
	    var device = devicesStore.getDeviceRef(device.id, device.address);
	    var config = [];
	
	    if (device) {
	        if (device.registryConfig.length) {
	            config = device.registryConfig;
	        }
	    } else {
	        config = _placeHolders;
	    }
	
	    return config;
	};
	
